import {useEffect, useState} from "react";
import OrderBook from "../components/OrderBook";
import coverImageUrl from "../img/bg.jpg";
export default function OrderPage() {
    const [orders, setOrders] = useState([
        {id:1,coverImageUrl:coverImageUrl,title:'title',author:'author',price:100,quantity:1},
        {id:2,coverImageUrl:coverImageUrl,title:'title',author:'author',price:100,quantity:1}
    ]);

    useEffect(() => {
        fetch('/orders')
            .then(response => response.json())
            .then(data => setOrders(data))
            .catch(error => console.error('Error fetching orders:', error));
    }, []);


    return (
        <div className="absolute w-full top-24 px-16  bg-gray-100">
            <div className="flex flex-col gap-4">
                {orders.map(book => <OrderBook book={book}/>)}
            </div>
            <div className="w-full h-20 bg-gray-100"></div>
        </div>
    )
}
